import sys

def show_size(x, level = 0):
    print('t'*level, f'type={x.__class__}, size={sys.getsizeof(x)}, object={x}')

    if hasattr(x, '__iter__'):
        if hasattr(x, 'items'):
            for xx in x.items():
                show_size(xx, level+1)
        elif not isinstance(x, str):
            for xx in x:
                show_size(xx, level+1)


# В массиве случайных целых чисел поменять местами минимальный и максимальный элементы.
# 1-й вариант O(n)
def option1(array):

    mn = [array[0], 0]
    mx = [array[0], 0]

    for i, val in enumerate(array):
        if val < mn[0]:
            mn = [val, i]
        if val > mx[0]:
            mx = [val, i]

    array[mn[1]] = mx[0]
    array[mx[1]] = mn[0]

    show_size(mn)
    show_size(mx)



# 2-й вариант O(4n)
def option2(array):
    mn = min(array)
    mx = max(array)
    imn = array.index(mn)
    imx = array.index(mx)
    array[imn], array[imx] = array[imx], array[imn]

    show_size(mn)
    show_size(mx)
    show_size(imn)
    show_size(imx)


# 3-й вариант O(n)
def option3(array):
    mn = 0
    mx = 0
    for i in range(len(array)):
        if array[i] < array[mn]:
            mn = i
        elif array[i] > array[mx]:
            mx = i
    array[mn], array[mx] = array[mx], array[mn]

    show_size(mn)
    show_size(mx)




